import React from 'react'
import {BsLinkedin} from 'react-icons/bs'
import {FaGithub} from 'react-icons/fa'
import {BsTwitter} from 'react-icons/bs'
import { useEffect } from 'react';
import AOS from 'aos'
import 'aos/dist/aos.css'

const Socials = () => {

  useEffect(() => {
    AOS.init({duration:2000})
  }, []);
  
  return (
    <div className='socials'>
        <a href="github.com" target='_blank' className='social__icon'><BsLinkedin /></a>
        <a href="linkedin.com" target='_blank' className='social__icon'><FaGithub /></a>
        <a href="dribble.com" target='_blank' className='social__icon'><BsTwitter /></a>
    </div>
  )
}

export default Socials
